INSERT INTO `project` VALUES (1,5158,3,'Communes Citoyennes','2018-01-17 00:00:00','2018-01-17 00:00:00','a:2:{i:0;s:36:\"ae7e940a53bc4549b17244d9a9c027aa.jpg\";i:1;s:36:\"8593f338f549e40a02f15d31003401be.jpg\";}','2018-01-17 00:00:00','2017-2018',NULL,'non','<p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">Création d\'un comité consultatif chargé de rédiger un contrat moral entre le Conseil Municipal et les habitants : une \"Constitution Municipale\"</span><br></p>',NULL,'<p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">Mieux intégrer les citoyens aux processus de décision et de projet. Créer du lien et libérer les énergies sur le territoire.</span><br></p>',NULL,'<p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">Communauté de communes, Plateforme nationale des listes participatives pour 2020</span><br></p>','<p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">Une première phase, différente, a eu lieu en 2016-2017, et s\'est débord attachée à libérer la parole dans un espace nouveau, sorte de laboratoire d\'idées, correspondant à une fonction majeure de la vie politique qui a été abandonnée par les partis au profit de l\'électoralisme ou du clientélisme.</span><br style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\"><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">Cette première phase s\'est conclue par une \"votation citoyenne\" lors du 1er tour de l\'élection présidentielle, sur des propositions élaborées par une trentaine de citoyens. Cette votation a intéressé 300 électeurs de la commune qui y ont participé.</span><br style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\"><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">Autour de cette démarche, nous remarquons chez les habitants un meilleur consentement aux projets de la commune, et un surcroît de participation à des actions concrètes pour le village.</span><br></p>','<p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">- La périodicité des réunions, les horaires de tenue, l\'assiduité.</span><br style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\"><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">- Les critiques de quelques-uns qui préféraient l\'ordre ancien.</span><br style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\"><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">- L\'indifférence d\'une partie de la population.</span><br></p>','<p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">De s\'enrichir (y compris par l\'économie réalisée lorsqu\'il y a un portage humain des projets) de l\'ouverture des processus de décision et de projet aux citoyens. De regarder les expériences ailleurs mais d\'adapter sa méthode à son propre environnement sociologique.</span></p><p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\"><br></span></p><p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\"><span style=\"text-size-adjust: auto;\">Identifier l\'espace méthodologique (créer un groupe de travail sur la méthode) et l\'espace de projet (créer un ou plusieurs groupes sur des projets concrets qui concernent le village). Faire en sorte d\'avoir moins d\'élus que de simples citoyens dans le groupe, savoir lâcher prise sur le leadership, déléguer.</span><br></span><br></p>','Yvan LUBRANESKI - François JAKOB - Philippe DEREGEL','respectivement Maire et, pour les deux autres, bénévoles facilitateurs','lubraneski@gmail.com','0686279986','852b5c30f63e98ffb4ed17157b80e458.pdf',NULL,NULL,'yvan lubraneski',NULL,'communes-citoyennes'),(3,5158,3,'Partenariat Application Mobile Court-voiturage','2018-01-17 00:00:00','2018-01-17 00:00:00','a:3:{i:0;s:36:\"db836587c57e6f18b3e8cf4fc5d55939.jpg\";i:1;s:36:\"c8fbae75e06fa0a12a575174fdea5982.jpg\";i:2;s:36:\"4e4f4a1a1e2cbb27674c40fc11ada24d.jpg\";}','2017-01-01 00:00:00','2017-2020','2000','non','<p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">Le maillage en transports collectifs étant faible, il y a un intérêt majeur à étudier des modes de transports collectifs nouveaux et complémentaires.</span><br></p>',NULL,'<p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">Transformer le véhicule particulier en un mode nouveau de transport collectif</span><br></p>',NULL,'<p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">Parc Naturel Régional de la Haute Vallée de Chevreuse</span><br></p>','<p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">En 4 mois, 80 inscrits sur la commune et déjà une quinzaine d\'utilisateurs réguliers</span><br></p>','<p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">Une masse critique d\'utilisateurs est nécessaire pour que l\'application propose à l\'usager un grand nombre de choix. Le démarrage est donc long. Nous avons cependant bénéficié d\'un partenariat entre l\'application mobile et le Département au moment du lancement dans notre commune.</span><br></p>','<p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">Voir les expériences alentours, choisir une application qui est utilisée dans des territoires voisins et/ou travailler un partenariat avec son EPCI, Parc Naturel, Syndicat de transports ou toute autre organisation publique pertinente.</span></p><p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\"><br></span></p><p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\"><span style=\"text-size-adjust: auto;\">Avoir un plan de communication articulé dans le temps et très visible.</span><br></span><br></p>','Yvan LUBRANESKI - Frédéric FABRE','Maire et 1er Adjoint','lubraneski@gmail.com','0686279986','736dd0a8cfcd79d081ee8e83c62dec23.pdf',NULL,NULL,NULL,NULL,'partenariat-application-mobile-court-voiturage'),(4,2848,3,'Réhabilitation commerce','2018-01-17 00:00:00','2018-01-17 00:00:00','a:0:{}','2017-01-01 00:00:00','Réalisé','306 K€','oui','<p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">Réhabiliter notre commerce local fermer depuis 1an et demi.</span><br style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\"><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">Nous avons acheté l\'ensemble des biens,  le  fond commercial, les murs et l’appartement.</span><br style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\"><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">Tout a été refait à neuf, nous avons fait appel à candidature pour la gérance .</span><br style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\"><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">Nous avons créer un chier des charges  que le gérant doit suivre pour  innover  ( circuits courts, festivités, aimantions,etc......), travailler avec les communes voisines comme la distribution du pain, livraison de produits épicerie, etc...</span><br style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\"><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">Proposer un bail très faible.</span><br></p>',NULL,'<p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">En faire un lieu de vie et d\'envie, un lieu de rencontre.</span><br></p>',NULL,'<p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">Commune  111K€</span></p><p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\"><span style=\"text-size-adjust: auto;\">Région, Département, DETR </span><span style=\"text-size-adjust: auto;\">195 K€</span><br></span><br></p>',NULL,'<p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">Amener des services nouveaux sur le commerce comme la Française des jeux, bureau de poste commerçant, vente de tabac (frontière avec le Luxembourg)</span><br></p>','<p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">Ne pas hésiter car cela amène vraiment de la vie dans le village.</span></p><p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\"><span style=\"text-size-adjust: auto;\">Convaincre les partenaires financiers et proposer un bail très faible.</span><br></span><br></p>','THIRY Philippe','Maire','amr54@lenoncourt.fr','0383469952','303b50271423babcacfaee3946f9c0c1.pdf',NULL,NULL,NULL,NULL,'rehabilitation-commerce'),(5,1460,3,'Parc aquatique en milieu rural','2018-01-18 00:00:00','2018-01-18 00:00:00','a:1:{i:0;s:36:\"1c7321317036b3acda4a50019831c2a7.jpg\";}','2016-01-01 00:00:00','1 an et demi','200000','oui','<p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">Création du 1er parc aquatique a jeux d\'eau gonflables sur un terrain communal pour les enfants de 1 à 12 ans accompagnés de leurs parents</span><br></p>','<p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">Partenariat public privé avec cession gratuite du terrain et gratuité de l\'eau et de l\'électricité la 1ère année</span><br></p>','<p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">Créations d\'emplois locaux d\'une économie locale et d\'une offre touristique sur un territoire qui en est dépourvu </span><br></p>','<p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">Demande de partenariat en septembre 2016 validation en conseil municipal en octobre 2016 lancement des travaux en février 2017 ouverture du parc le 15 juin 2017</span><br></p>','<p><span style=\"font-family: Arial; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">Commune 10000€</span></p><p><span style=\"font-family: Arial; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\"><span style=\"font-family: arial, sans, sans-serif; text-size-adjust: auto;\">commune de saint etienne des sorts</span><br></span><br></p>','<p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">350 entrées par jour de juillet a fin septembre 2017</span><br></p>','<p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">Aucune aide du mille feuilles </span><br></p>','<p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">Allez sur le site MOBY LAND vous y trouverez tous produits fait pour les collectivités territoriales.</span></p><p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\"><br></span></p><p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\"><span style=\"text-size-adjust: auto;\">Ce concept innovant apporte de l\'économie du tourisme et de l\'emploi</span><br></span><br></p>','BONNEAUD Didier','Maire','didier.bonneaud@engie.com','0680585827','6555f7b285e9cf6607992386a270d06b.pdf',NULL,NULL,NULL,NULL,'parc-aquatique-en-milieu-rural'),(6,1460,3,'Huile communale','2018-01-18 00:00:00','2018-01-18 00:00:00','a:3:{i:0;s:36:\"ff84e832e83fef9e3be207fc7a42157e.jpg\";i:1;s:36:\"1c9ed4119e286724a93c85cd791c2aa0.jpg\";i:2;s:36:\"c488e63d321fe426491511c204b15168.jpg\";}','2017-12-01 00:00:00','1 mois','100','non','<p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">Ramassage des olives communales et remise d\'une bouteilles d\'huile  aux aînés</span><br></p>','<p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">Economie circulaire de proximité</span><br></p>','<p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">Utiliser une ressource gratuite</span><br></p>','<p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">Proposition du maire et validation en conseil</span><br></p>','<p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">conseil municipal</span><br></p>','<p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">Satisfaction des administres et des habitants de l\'agglomération</span><br></p>','<p>Aucune</p>','<p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">Projet de bon sens de l\'utilisation des ressources communales</span></p><p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\"><span style=\"text-size-adjust: auto;\">Merci a Midi Libre d\'avoir mis en 1ere page cet article</span><br></span><br></p>','BONNEAUD Didier','Maire','didier.bonneaud@engie.com','0680585827','e321321e45402e9c43ff182b630a7a49.pdf',NULL,NULL,NULL,NULL,'huile-communale'),(7,2697,3,'PLANTONS des FRUITS','2018-01-18 00:00:00','2018-01-18 00:00:00','a:3:{i:0;s:36:\"9aeb0aff1702312c4c038d2d65d26a00.jpg\";i:1;s:36:\"ca0ab5af4e8ddf451b67a09debd850e9.jpg\";i:2;s:36:\"bb27a7d6a5059fbbb5ee0e701f15527e.jpg\";}','2018-01-18 00:00:00','2015-2020','Environ 1500 € / an','non','<p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">Plantations sur plusieurs années d\'arbres et d\'arbustes fruitiers (+ de 200 avec plus de 20 espèces)</span><br></p>','<p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">Projet mis en place avec les employés communaux et les écoles il y a 3 ans </span><br></p>','<p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">Donner une thématique originale pour faire à terme un parcours éducatif et ludique. Les enfants de 2 classes ont démarré le projet et une formation au greffage a été faites avec les croqueurs de pommes.  Offrir aux habitants la possibilité de venir récolter des fruits. Créer plus tard des animations autour des fruits comme des marchés, des expositions photos ou peintures, des ateliers cuisine en liaison avec le lycée agricole et la banque alimentaire .... Une boite à livre sur cette thématique ...</span><br></p>','<p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">Première plantation et explication avec panneaux et démonstration par les employés communaux auprès des enfants et enseignants en Novembre 2015.  Concours de signalétique avec les enfants de l\'école.   Formation greffage hiver et printemps 2016 avec une association et les employés et habitants.  Plantations tous les ans.  Signalétique à mettre en place en 2018.</span><br></p>','<p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">Entreprises locales</span><br></p>','<p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">Des aides ponctuelles sur l\'achat de plants</span><br></p>','<p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">Pas de retours de pépiniéristes locaux plutôt des aides et accompagnement par des commerces type \"Jardiland, Bricomarché\" ...</span><br></p>','<p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">D\'être motivé et de faire participer les employés et la population.  Avec envie et bonne volonté on imagine les projets de demain.</span><br></p>','CORBEL Anne Marie','Maire','mairie.lehommetdarthenay@gmail.com','0233562172','3947f89b3d2bf4956f3e9f130f0adc68.pdf',NULL,NULL,NULL,NULL,'plantons-des-fruits'),(8,59,2,'Panneaux Photovoltaiques toit église','2018-01-18 10:32:34','2018-01-18 10:32:34','a:2:{i:0;s:36:\"a72aed5a5684a77427b1b24480053ba0.jpg\";i:1;s:36:\"488ad0cf11cf8f4931358f7f0a65d93c.jpg\";}','2012-01-01 00:00:00','2 ans','237K dont 80K € spécifiquement photovoltaique',NULL,'Pour remplacer une toiture défectueuse de l\'église une solution avec panneaux photovoltaïque a été envisagée.  130 m² ont été réalisés avec des tuiles photovoltaïques conférant au toit versant sud un aspect compatible avec le clocher couvert en ardoises.','<p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">Travaux de rénovation du toit de l\'église</span><br></p>','<p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">Participer à la transition énergétique tout en assurant un petit revenu dédié à l\'entretien obligatoire de l\'église</span><br></p>','<p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">1Etude de faisabilité technique (surface, exposition au soleil...) et en particulier calepinage du toit pour répondre à des exigences esthétiques. Etudes financières relatives au coût du projet et au retour d\'investissement en fonction du prix de rachat de l\'énergie. Discussion avec les autorités religieuses.</span><br style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\"><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">  2 En parallèle discussion avec le conseil municipal : information de la population (l\'église est un lieu sensible, problématique de fin de vie des panneaux , entretien etc)</span><br style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\"><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">  3 Marchés  Contrat EDF</span><br style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\"><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">  4 Réalisation</span><br></p>','<p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">Etat, Région</span><br></p>','<p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">Installation conforme aux prévisions. Bonne acceptation par la population</span><br></p>','<p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">Quelques oppositions au début du projet.</span><br></p>','<p><span style=\"font-family: arial, sans, sans-serif; font-size: 13px; white-space: pre-wrap; text-size-adjust: auto;\">De la patience...</span><br></p>','Lay Christian','Maire','mairie.cruzilles@gmail.com','0385315227',NULL,NULL,NULL,NULL,NULL,'panneaux-photovoltaiques-toit-eglise');
