INSERT INTO `public_page` VALUES (1,'main-1','2018-12-20 10:00:00','Le Wiki des Maires : qu’est-ce que c’est ?','<p>\r\nA destination des communes adhérentes de l’Association des Maires Ruraux de France et de ses partenaires, le Wiki des Maires permet de partager et d’échanger sur des projets mis en place par les communes rurales.\r\n</p>\r\n<p>\r\nLe Wiki des Maires a pour objectif de <strong>valoriser les initiatives menées</strong> et de <strong>faciliter les échanges</strong>, en mettant à disposition les coordonnées des porteurs de projets et des partenaires mobilisés. Créatrice de lien entre les membres du réseau, cette plateforme interactive illustre le dynamisme des communes et l’implication des élus pour leur territoire et leurs administrés.\r\n</p>\r\n<p>\r\nL’échelon communal permet l’innovation et la réalisation de projets concrets. Le Wiki des Maires, en est une traduction et l’incarnation numérique de la devise de l’Association « Des maires au service des maires ».\r\n</p>'),(2,'main-2','2012-01-01 00:00:00','Comment l’utiliser ?','<h5><i class=\"fa fa-share-square-o\"></i> Je partage</h5>\r\n            <p>\r\n                Vous avez un projet, une initiative, une réalisation à valoriser ou une expertise à apporter ?\r\n                Enrichissez la base et partagez votre enthousiasme !\r\n            </p>\r\n            <h5><i class=\"fa fa-search\"></i> Je recherche</h5>\r\n            <p>\r\n                Vous voulez savoir si un projet similaire au vôtre a déjà été mis en place par quelqu’un et comment il\r\n                s’y est pris ? Vous souhaitez avoir une liste des projets réalisés selon une thématique donnée ? Ou tout\r\n                simplement, vous aimeriez connaître les actions menées autour de vous ou dans un département particulier\r\n                ? Le Wiki des Maires est la solution qui met en avant l’expérience des maires et l’expertise de nos\r\n                partenaires.\r\n                Alors partez à la recherche et inspirez-vous !\r\n            </p>'),(3,'footer','2012-01-01 00:00:00','footer','<p>\r\n                Depuis 1971, l\'Association des Maires Ruraux de France (AMRF) fédère, informe et représente\r\n                près de 10000 maires de communes rurales pour défendre et promouvoir les enjeux spécifiques\r\n                de la ruralité.\r\n\r\n            <span class=\"hidden-xs\">\r\n                Réseau convivial et solidaire d\'associations départementales - en toute indépendance des\r\n                pouvoirs et partis politiques - l\'AMRF est un représentant incontournable du monde rural auprès\r\n                des pouvoirs publics et des grands opérateurs nationaux.\r\n            </span>\r\n            </p>'),(4,'amrf-1','2012-01-01 00:00:00','L\'association des maires ruraux de France','<p>Créée en 1971, l\'Association des maires ruraux de France (AMRF) fédère près de 10&nbsp;000&nbsp;maires\r\n            ruraux au sein d\'un réseau solidaire, en toute indépendance des pouvoirs et partis politiques.\r\n            Rassemblés autour d\'une identité forte, les membres de l\'AMRF portent la voix des communes\r\n            ancrées sur les territoires ruraux pour défendre leurs enjeux spécifiques.<br>\r\n            Forte de son militantisme et de sa représentativité, l\'AMRF est aujourd\'hui l\'interlocutrice\r\n            incontournable des communes rurales auprès des pouvoirs publics et des grands opérateurs\r\n            nationaux.</p>'),(5,'amrf-2','2012-01-01 00:00:00','Défendre les enjeux de la ruralité','<p>Dans un esprit militant, l\'AMRF fédère, informe et représente les maires des communes de moins\r\n            de 3&nbsp;500&nbsp;habitants, partout en France.<br>\r\n            L\'association s\'engage au quotidien - au niveau local et national - pour défendre et promouvoir\r\n            les enjeux spécifiques de la ruralité. Elle participe au débat public en formulant des propositions\r\n            et en réalisant des interventions. Elle produit des manifestes et publie des rapports et des\r\n            contributions lors des discussions parlementaires.</p>'),(6,'amrf-3','2012-01-01 00:00:00','Un réseau au service des territoires ruraux','<p>Les associations départementales, en totale autonomie, représentent les maires ruraux auprès\r\n            des interlocuteurs publics du département et services déconcentrés (Préfecture, Conseil\r\n            Départemental, Inspection d\'Académie, Gendarmerie...) et des opérateurs de services.<br>\r\n            Formant un réseau de proximité efficace, elles sont une force d\'information et de mobilisation très\r\n            réactive.</p>'),(7,'ml','2013-01-01 00:00:00','Mentions Légales','<div class=\"accordion\" role=\"tablist\">\r\n            <div class=\"card\">\r\n                <div class=\"card-header\" role=\"tab\" id=\"headingOne\"><span id=\"docs-internal-guid-5669dd19-0883-4e7f-0cfc-7e746d51f073\"><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 12pt; font-family: Cambria; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">MENTIONS LÉGALES</span></p><br><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 12pt; font-family: Cambria; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">AMRF, Association des maires ruraux de France</span></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 12pt; font-family: Cambria; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Association Loi 1901 - N°SIRET 328 116 280 00061</span></p><br><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 12pt; font-family: Cambria; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">52 Avenue Maréchal Foch – 69006 Lyon</span></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 12pt; font-family: Cambria; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Téléphone&nbsp;: 04 37 43 39 80 – </span><a href=\"mailto:amrf@amrf.fr\"><span style=\"font-size: 12pt; font-family: Cambria; color: rgb(0, 0, 255); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; text-decoration-line: underline; vertical-align: baseline; white-space: pre-wrap;\">amrf@amrf.fr</span></a><span style=\"font-size: 12pt; font-family: Cambria; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"> </span></p><br><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><a href=\"http://www.amrf.fr\"><span style=\"font-size: 12pt; font-family: Cambria; color: rgb(0, 0, 255); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; text-decoration-line: underline; vertical-align: baseline; white-space: pre-wrap;\">www.amrf.fr</span></a></p><br><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 12pt; font-family: Cambria; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Directeur de publication : Cédric Szabo, Directeur</span></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 12pt; font-family: Cambria; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Conception et développement : Wild Code School – 17 rue Delandine – 69002 Lyon - </span><a href=\"https://www.google.fr/search?client=safari&amp;rls=en&amp;q=WILD+CODE+SCHOOL&amp;ie=UTF-8&amp;oe=UTF-8&amp;gfe_rd=cr&amp;dcr=0&amp;ei=5sxcWqDRCI7Z8AeotI2wAw\"><span style=\"font-size: 12pt; font-family: Cambria; color: rgb(0, 0, 0); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">06 58 46 83 32</span></a></p><br><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 12pt; font-family: Cambria; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Responsable de la rédaction : Service communication AMRF</span></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 12pt; font-family: Cambria; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Hébergement : OVH - 2 rue Kellermann BP 80157 - 59100 Roubaix – 0972101007</span></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 12pt; font-family: Cambria; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Numéro de déclaration normale Cnil&nbsp;: 2111500v0</span></p><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 12pt; font-family: Cambria; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Crédit photo première page : Pixabay</span></p><br><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 12pt; font-family: Cambria; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Les contenus de ce&nbsp;site peuvent inclure des inexactitudes ou des erreurs. L’AMRF se réserve le droit d’apporter des modifications, des améliorations et des changements sur les informations décrites sur son site à tout moment.</span></p><br><p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 12pt; font-family: Cambria; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Conformément à l’article 34 de la loi « Informatique et Libertés » du 6 janvier 1978, vous disposez d’un droit d’accès, de modification, de rectification et de suppression des données qui vous concernent. Pour exercer ce droit, adressez un courrier à AMRF &nbsp;- Wiki des maires – 52 Avenue Maréchal Foch 69006 LYON ou formulez votre demande par mail à&nbsp;</span><span style=\"font-size: 12pt; font-family: Cambria; color: rgb(0, 0, 255); background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; text-decoration-line: underline; vertical-align: baseline; white-space: pre-wrap;\"><a href=\"mailto:amrf@amrf.fr\">amrf@amrf.fr</a></span></p><div><br></div></span></div></div><div class=\"card\">\r\n                <div id=\"collapseTwenty\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingTwenty\" data-parent=\"#accordion\">\r\n                    <p class=\"card-body\">\r\n                        Pour obtenir davantage d’informations relatives aux questions juridiques contenues dans ces\r\n                        conditions d’utilisation, ou à des questions ou problèmes concernant ce service, veuillez écrire\r\n                        en utilisant le formulaire de contact mis à votre disposition sur ce site.\r\n                    </p>\r\n                </div>\r\n            </div>\r\n        </div>'),(8,'cgu','2012-01-01 00:00:00','Déclaration de confidentialité sur le site','<div class=\"accordion\" role=\"tablist\">\r\n            <div class=\"card\">\r\n                <div class=\"card-header\" role=\"tab\" id=\"headingOne\">\r\n                    <a data-toggle=\"collapse\" href=\"#collapseOne\" aria-expanded=\"true\" aria-controls=\"collapseOne\">\r\n                        <h3>\r\n                            Collecte de vos informations personnelles\r\n                        </h3>\r\n                    </a>\r\n                </div>\r\n                <div id=\"collapseOne\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingOne\" data-parent=\"#accordion\">\r\n                    <p class=\"card-body\">\r\n                        Nous vous demanderons des informations lorsque nous aurons besoin de données permettant de vous\r\n                        identifier personnellement (informations personnelles) ou dans le but de vous contacter. En\r\n                        général, ces informations sont nécessaires lorsque nous vous fournissons un service ou\r\n                        effectuons une transaction dont vous avez fait la demande, par exemple pour des informations sur\r\n                        des produits et services de ce Site, l\'inscription à un concours, la commande de bulletins\r\n                        d\'information par courrier électronique, l\'accès à un site prioritaire à accès limité ou l\'achat\r\n                        et l\'enregistrement de produits sur ce Site. Les informations personnelles que nous collectons\r\n                        peuvent comprendre votre nom, votre fonction, le nom de votre entreprise ou de votre\r\n                        organisation, votre adresse de messagerie professionnelle, votre numéro de téléphone\r\n                        professionnel, votre adresse postale professionnelle ou personnelle, des informations sur votre\r\n                        fonction ou sur votre entreprise, et des informations sur votre carte de crédit.\r\n\r\n                        Le Site peut également collecter des informations sur votre visite, dont le nom de votre\r\n                        fournisseur d\'accès Internet et l\'adresse IP utilisés pour accéder à Internet, la date et\r\n                        l\'heure d\'accès au site, les pages auxquelles vous accédez sur le Site et l\'URL du site à partir\r\n                        duquel vous êtes arrivé sur notre site. Ces informations sont destinées à l\'analyse des\r\n                        tendances et à l\'administration et l\'amélioration du Site.\r\n\r\n                        Afin d\'éviter que votre adresse de messagerie ou d\'autres informations personnelles ne soient\r\n                        récupérées et mal utilisées par d\'autres, nous vous recommande d\'être prudent quant à\r\n                        l\'utilisation d\'une adresse de messagerie existante ou d\'autres informations personnelles dans\r\n                        des groupes de discussion, des conversations ou autres forums publics.\r\n                    </p>\r\n                </div>\r\n            </div>\r\n            <div class=\"card\">\r\n                <div class=\"card-header\" role=\"tab\" id=\"headingTwo\">\r\n                    <a data-toggle=\"collapse\" href=\"#collapseTwo\" aria-expanded=\"true\" aria-controls=\"collapseTwo\">\r\n                        <h3> Utilisation de vos données personnelles</h3>\r\n                    </a>\r\n                </div>\r\n                <div id=\"collapseTwo\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingTwo\" data-parent=\"#accordion\">\r\n                    <p class=\"card-body\">\r\n                        Les informations personnelles collectées sur ce Site sont utilisées pour le fonctionnement du\r\n                        Site et pour nous permettre de vous fournir le service ou de mener à bien la transaction que\r\n                        vous avez demandé ou autorisé.\r\n\r\n                        Dans le cadre de ces utilisations, ce Site peut utiliser des informations personnelles dans le\r\n                        but de vous fournir un service clientèle plus efficace, pour améliorer le Site et tout autre\r\n                        produit ou service de ce Site et pour vous faciliter la navigation en vous évitant d\'entrer\r\n                        plusieurs fois les mêmes informations ou en adaptant le site à vos préférences ou vos intérêts.\r\n                        Afin de vous proposer un environnement constant dans vos interactions avec notre Site, les\r\n                        informations collectées peuvent être utilisées en combinaison avec celles collectées par\r\n                        d\'autres services de notre Site.\r\n\r\n                        Nous pouvons utiliser vos informations personnelles pour vous faire parvenir des informations\r\n                        importantes sur le produit ou le service que vous utilisez.\r\n\r\n                        Nous combinons les données de visites du site avec des données démographiques anonymes dans le\r\n                        but d’effectuer des recherches ; les volumes d’informations obtenus sont utilisés de manière à\r\n                        vous fournir le contenu que vous attendez. Dans certaines zones d’accès limité de notre Site,\r\n                        avec votre accord, nous combinerons les données de visite du site avec vos données personnelles\r\n                        de manière à vous proposer des contenus personnalisés. Sans votre autorisation, nous ne serons\r\n                        pas en mesure de vous fournir un service personnalisé et nous ne pourrons pas combiner vos\r\n                        données personnelles avec celles des visites du site.\r\n\r\n                        Lorsque vous vous inscrivez à un bulletin d\'information ou que vous déclarer que vous souhaitez\r\n                        recevoir des messages électroniques publicitaires, notre Site peut utiliser des liens\r\n                        personnalisés ou d\'autres technologies similaires pour suivre les liens sur lesquels vous\r\n                        cliquez dans les messages électroniques. Nous pouvons associer ces informations à vos\r\n                        informations personnelles afin de vous envoyer des messages ou des informations encore plus\r\n                        ciblés.\r\n\r\n                        Certains services sur notre Site offrent aux particuliers la possibilité d\'afficher publiquement\r\n                        certaines informations personnelles, par exemple pour un de nos partenaires qui souhaite publier\r\n                        ses informations de contact dans le cadre des services qu\'il propose. La participation à de tels\r\n                        services est toujours facultative.\r\n\r\n                        Notre Site utilise parfois d\'autres entreprises pour fournir certains services de sa part. Il\r\n                        peut s\'agir par exemple de l\'hébergement de sites Web, de l\'empaquetage, de l\'expédition et de\r\n                        la livraison de prix, de réponses à des questions posées par un client sur les produits et\r\n                        services ou encore de l\'envoi d\'informations sur nos produits, nos offres spéciales ou d\'autres\r\n                        nouveaux services. Nous ne transmettrons à ces entreprises que les informations personnelles\r\n                        nécessaires à leur service. Ces entreprises sont tenues de respecter la confidentialité de ces\r\n                        informations et ne peuvent en aucun cas les utiliser dans un autre but.\r\n\r\n                        Nous communiquerons vos informations personnelles uniquement si la loi l’exige ou si nous\r\n                        pensons en toute bonne fois qu’il est nécessaire de nous conformer à des décrets de loi ou à une\r\n                        procédure légale, protéger et défendre nos droits ou nos propriétés et agir dans des cas\r\n                        d’urgence pour protéger la sécurité personnelle de nos employés et utilisateurs du site.\r\n\r\n                        Les informations personnelles collectées sur le Site peuvent être stockées et utilisées en\r\n                        France ou dans tout autre pays par ses filiales, ses partenaires ou ses agents sont présents. En\r\n                        utilisant le Site, vous consentez à de tels transferts de vos informations personnelles en\r\n                        dehors de votre pays.\r\n\r\n                        Nous respectons et nous conformons à la loi du 6 janvier 1978 (lien vers le site de la CNIL).\r\n                    </p>\r\n                </div>\r\n            </div>\r\n            <div class=\"card\">\r\n                <div class=\"card-header\" role=\"tab\" id=\"headingThree\">\r\n                    <a data-toggle=\"collapse\" href=\"#collapseThree\" aria-expanded=\"true\" aria-controls=\"collapseThree\">\r\n                        <h3>Contrôle de vos informations personnelles</h3>\r\n                    </a>\r\n                </div>\r\n                <div id=\"collapseThree\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingThree\" data-parent=\"#accordion\">\r\n                    <p class=\"card-body\">\r\n                        Sauf indication contraire dans cette déclaration, les informations personnelles que vous\r\n                        fournissez sur le Site ne seront pas transmises en dehors de ses filiales et partenaires sans\r\n                        votre autorisation. Tel que décrit dans la section qui suit, vous pouvez accéder à vos\r\n                        informations personnelles et choisir comme vous souhaitez être contacté.\r\n\r\n                        Cette déclaration de confidentialité et les choix que vous faites sur le Site ne s\'appliquent\r\n                        pas forcément aux informations personnelles que vous nous avez fournies dans le contexte\r\n                        d\'autres produits ou services distincts.\r\n\r\n                        Nous pouvons vous envoyer régulièrement des courriers électroniques pour vous informer des\r\n                        problèmes de service technique ou de sécurité liés à un produit ou un service que vous avez\r\n                        demandé, ou accuser réception d’une demande de produit ou de service. Dans certains services\r\n                        offerts sur notre Site, le contact avec le client est un élément essentiel du service. Vous ne\r\n                        pourrez pas annuler votre inscription à ces publipostages car ils font partie intégrante du\r\n                        service que vous avez choisi.\r\n                    </p>\r\n                </div>\r\n            </div>\r\n            <div class=\"card\">\r\n                <div class=\"card-header\" role=\"tab\" id=\"headingFour\">\r\n                    <a data-toggle=\"collapse\" href=\"#collapseFour\" aria-expanded=\"true\" aria-controls=\"collapseFour\">\r\n                        <h3>Accès à vos données personnelles</h3>\r\n                    </a>\r\n                </div>\r\n                <div id=\"collapseFour\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingFour\" data-parent=\"#accordion\">\r\n                    <p class=\"card-body\">\r\n                        Vous pouvez rectifier vos données personnelles et vos informations de contact sur ce Site après\r\n                        vous être identifié.\r\n\r\n                        Certains services que nous offrons peuvent recueillir des informations non accessibles par le\r\n                        biais de vos paramètres personnels. Toutefois, dans ce cas, vous pouvez accéder à vos données\r\n                        personnelles en nous contactant comme expliqué au bas de cette déclaration, ou via d’autres\r\n                        sources de communication décrites par le service.\r\n                    </p>\r\n                </div>\r\n            </div>\r\n            <div class=\"card\">\r\n                <div class=\"card-header\" role=\"tab\" id=\"headingFive\">\r\n                    <a data-toggle=\"collapse\" href=\"#collapseFive\" aria-expanded=\"true\" aria-controls=\"collapseFive\">\r\n                        <h3>Sécurité de vos informations personnelles</h3>\r\n                    </a>\r\n                </div>\r\n                <div id=\"collapseFive\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingFive\" data-parent=\"#accordion\">\r\n                    <p class=\"card-body\">\r\n                        Nous vous garantissons rigoureusement la protection de vos informations personnelles. Nous\r\n                        faisons appel à diverses technologies et procédures de sécurité afin d’assurer la protection de\r\n                        vos données personnelles et éviter qu’elles ne soient consultées, utilisées ou divulguées sans\r\n                        autorisation. Par exemple, nous stockons les données que vous nous fournissez sur des serveurs\r\n                        dont l’accès est limité et qui sont situés dans des installations surveillées. De plus, lorsque\r\n                        nous transmettons des informations confidentielles sensibles sur Internet (un numéro de carte de\r\n                        crédit, par exemple), ces informations sont protégées au moyen d’un système de cryptage tel que\r\n                        le protocole SSL (Secure Socket Layer) ou toutes autres techniques permettant le chiffrement de\r\n                        ces informations.\r\n                    </p>\r\n                </div>\r\n            </div>\r\n            <div class=\"card\">\r\n                <div class=\"card-header\" role=\"tab\" id=\"headingSix\">\r\n                    <a data-toggle=\"collapse\" href=\"#collapseSix\" aria-expanded=\"true\" aria-controls=\"collapseSix\">\r\n                        <h3>Protection des informations personnelles des enfants</h3>\r\n                    </a>\r\n                </div>\r\n                <div id=\"collapseSix\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingSix\" data-parent=\"#accordion\">\r\n                    <p class=\"card-body\">\r\n                        Notre Site ne collecte pas volontairement les informations personnelles des enfants.\r\n                    </p>\r\n                </div>\r\n            </div>\r\n            <div class=\"card\">\r\n                <div class=\"card-header\" role=\"tab\" id=\"headingSeven\">\r\n                    <a data-toggle=\"collapse\" href=\"#collapseSeven\" aria-expanded=\"true\" aria-controls=\"collapseSeven\">\r\n                        <h3>Cookies</h3>\r\n                    </a>\r\n                </div>\r\n                <div id=\"collapseSeven\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingSeven\" data-parent=\"#accordion\">\r\n                    <p class=\"card-body\">\r\n                        Les cookies sont utilisés sur ce Site pour assurer l\'intégrité du processus d\'inscription et\r\n                        pour personnaliser le Site. Un cookie est un petit fichier texte placé sur votre disque dur par\r\n                        un serveur de pages Web. Il ne peut pas être utilisé pour exécuter des programmes ou pour\r\n                        infecter votre ordinateur avec des virus. Les cookies vous sont adressés exclusivement et\r\n                        peuvent être lus uniquement par les serveurs Web appartenant au domaine qui vous a livré le\r\n                        cookie.\r\n\r\n                        L’une des principales fonctions pratiques des cookies est de vous faire gagner du temps. Par\r\n                        exemple, si vous personnalisez une page Web, ou naviguez dans un site, le cookie aidera le site\r\n                        à trouver vos informations spécifiques au cours des visites suivantes. Cela permet, notamment,\r\n                        de simplifier le processus de livraison des contenus qui vous intéressent et la navigation sur\r\n                        le site. Lorsque vous revenez sur le site, les informations que vous avez fournies auparavant\r\n                        sont réutilisées pour vous permettre d’utiliser plus facilement les fonctions du site que vous\r\n                        avez personnalisé.\r\n\r\n                        Nous pouvons également utiliser des pixels invisibles, également connus sous le nom de GIF\r\n                        invisible, pour aider à l\'implantation du cookie. Nous utilisons cette technologie comme un\r\n                        outil de compilation de statistiques relatives à l\'utilisation de notre Site. Ces statistiques\r\n                        incluent le nombre de visiteurs ayant cliqué sur les éléments clés (par exemple des liens ou des\r\n                        graphismes) d\'une page Web, d\'une page de journal Web ou d\'un bulletin d\'information de notre\r\n                        Site. Nous sommes susceptibles de partager des statistiques compilées avec des entreprises\r\n                        partenaires, mais nous n\'autorisons pas d\'autres entreprises à placer des images .gif ou des\r\n                        cookies sur nos sites, sauf dans le cas d\'un intérêt particulier temporaire pour nos clients\r\n                        (par exemple par l\'intégration d\'un service d\'un site basé sur des cookies tiers ou des .gif\r\n                        clairs).\r\n\r\n                        Vous pouvez accepter ou refuser les cookies. La plupart des navigateurs Web acceptent les\r\n                        cookies automatiquement, mais vous pouvez modifier les paramètres de votre navigateur pour leur\r\n                        refuser l’accès à votre ordinateur si vous le souhaitez. Si vous choisissez de refuser les\r\n                        cookies, vous risquez de ne pas pouvoir utiliser complètement les fonctions interactives de ce\r\n                        site ou d’autres sites Web que vous visiterez.\r\n                    </p>\r\n                </div>\r\n            </div>\r\n            <div class=\"card\">\r\n                <div class=\"card-header\" role=\"tab\" id=\"headingEight\">\r\n                    <a data-toggle=\"collapse\" href=\"#collapseEight\" aria-expanded=\"true\" aria-controls=\"collapseEight\">\r\n                        <h3>Application de cette déclaration de confidentialité</h3>\r\n                    </a>\r\n                </div>\r\n                <div id=\"collapseEight\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingEight\" data-parent=\"#accordion\">\r\n                    <p class=\"card-body\">\r\n                        Si vous avez des questions concernant cette déclaration, contactez-nous par le biais du\r\n                        formulaire que nous mettons à votre disposition auquel vous avez accès après vous être\r\n                        identifié.\r\n                    </p>\r\n                </div>\r\n            </div>\r\n            <div class=\"card\">\r\n                <div class=\"card-header\" role=\"tab\" id=\"headingNine\">\r\n                    <a data-toggle=\"collapse\" href=\"#collapseNine\" aria-expanded=\"true\" aria-controls=\"collapseNine\">\r\n                        <h3>Modifications de cette déclaration de confidentialité</h3>\r\n                    </a>\r\n                </div>\r\n                <div id=\"collapseNine\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingNine\" data-parent=\"#accordion\">\r\n                    <p class=\"card-body\">\r\n                        Nous mettons occasionnellement à jour cette déclaration de confidentialité. Dans ce cas, nous\r\n                        corrigeons également la date de « dernière mise à jour » en haut de la déclaration de\r\n                        confidentialité. En cas de modifications substantielles de cette déclaration, nous vous le\r\n                        signalerons en plaçant une notice visible sur la page d\'accueil du site ou en vous envoyant\r\n                        directement une notification. Nous vous encourageons à consulter régulièrement cette déclaration\r\n                        de confidentialité afin de rester informé de comment nous vous aidons à protéger les\r\n                        informations personnelles que nous collectons. L\'utilisation continue de ce service constitue\r\n                        votre accord quant à cette déclaration de confidentialité et à ses mises à jour.\r\n                    </p>\r\n                </div>\r\n            </div>\r\n            <div class=\"card\">\r\n                <div class=\"card-header\" role=\"tab\" id=\"headingTen\">\r\n                    <a data-toggle=\"collapse\" href=\"#collapseTen\" aria-expanded=\"true\" aria-controls=\"collapseTen\">\r\n                        <h3>Contacts</h3>\r\n                    </a>\r\n                </div>\r\n                <div id=\"collapseTen\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingTen\" data-parent=\"#accordion\">\r\n                    <p class=\"card-body\">\r\n                        Vos commentaires concernant cette déclaration de confidentialité sont les bienvenus. Si vous\r\n                        estimez que notre Site n\'a pas respecté cette déclaration de confidentialité, contactez-nous par\r\n                        voie électronique ou par courrier postal à l\'adresse se trouvant sur les conditions\r\n                        d\'utilisation, et nous userons de tous moyens raisonnables pour rapidement déterminer le\r\n                        problème et y remédier.\r\n                    </p>\r\n                </div>\r\n            </div>\r\n        </div>');
